import React, { Fragment } from "react";
import styles from "./Contacts2.module.scss";
import Layout from "components/layouts/Layout/Layout";
import { AddressBox, Button } from "components/elements";
import THEME from "state/theme";
import { useCustomState } from "state/state";

export default () => {
  const actions = useCustomState()[1];

  return (
    <Fragment>
      <div className={styles.header}>
        <span className="subtitle" style={{ color: THEME.color }}>

        </span>
        <h2>관광지 추가</h2>

      </div>
      <Layout col="4">
        <AddressBox
          icon="las la-phone"
          title="Call Us"
          text="+987 (077) 456-234"
        />
        <AddressBox
          icon="la la-envelope-open"
          title="Mail Us"
          text="admin@mail.com"
        />
        <AddressBox
          icon="la la-home"
          title="Visit Us"
          text="Otaki, 32 Wilson Street"
        />
        <AddressBox
          icon="las la-comment"
          title="Support"
          text="Live chart 24/7"
        />
        <span className={styles.divider} style={{ borderColor: THEME.color }} />
      </Layout>


    </Fragment>
  );
};
